import React, { Component } from "react";
import "./HomePge.css";
import { Link, NavLink } from "react-router-dom";
class HomePage extends Component {
  state = {
    email: "",
    password: ""
  };
  render() {
    return (
      <div className="container-home">
        {/*Form with header*/}
        <div className="card_form">
          <div className="card-block">
            {/*Header*/}
            <div className="form-header  purple darken-4">
              <h3>
                <i className="fa fa-lock" /> Login:
              </h3>
            </div>
            {/*Body*/}
            <div className="md-form">
              <i className="fa fa-envelope prefix" />
              <label htmlFor="form2">Your email</label>
              <input
                type="text"
                id="form2"
                name="email"
                className="form-control"
              />
            </div>
            <div className="md-form">
              <i className="fa fa-lock prefix" />
              <label htmlFor="form4">Your password</label>
              <input type="password" id="form4" className="form-control" />
            </div>
            <div className="form_button">
              <button className="btn btn-success success">Login</button>
              <NavLink to="/">
                {" "}
                <button className="btn btn-light danger ">Sign up</button>
              </NavLink>
            </div>
          </div>
          {/*Footer*/}
        </div>
      </div>
    );
  }
}

export default HomePage;
